import React from 'react';

const PopupWithForm = (props) => {
  const [isPopupOpen, setPopupOpen] = React.useState(false);

  return (
    <form id={`popup${props.name}`} className="popup popup_half-transparent" noValidate>
      <div className="popup__form-container popup__form-container_large">
        <button type="reset" className="popup__close-button" value=""></button>
        <h2 className="popup__title">Новое место</h2>
        <button type="submit" className="popup__save-button popup__save-button_disabled" disabled>Создать</button>
       </div>
    </form>
  );
}

export default PopupWithForm;
